import React, {Component} from "react";
import Header from "../template/Header";
import { ApiurlUsers } from "../services/apirest";
import axios from 'axios';
import Main2 from  './Main2'

class VerReceta extends Component{

    state={
        menu:[]
    } ;


    clickUsers(email){
        this.props.history.push("/editar/"+ email);
    }


    
    componentDidMount(){
            let id = this.props.match.params.id;  

            let url = ("https://siglo-xxi-products.azurewebsites.net/Products/v1/menu/"+id);
            axios.get(url)
            .then(response =>{
                this.setState({
                    menu : response.data.menu
                })
                
            })
    }

    render(){
        return(
               
            <React.Fragment>

        <Main2></Main2>
              
                <Header></Header>
<br></br>
                <div className="container">
                    

                <table id="customers" className="table table-striped">
                    <thead>
                        <tr>
              
                        <th scope="col">Id</th>
                        <th scope="col"></th>
                        </tr>
                    </thead>
                    <tbody> 
                        {this.state.menu.map((value, index) => {
                           return (
                            <tr key={index}   >

                            <td>{value.id}</td>
                           
                            <td>
                                <button >
                                Editar
                                </button>
                                </td>
                            </tr>
                            )
                        })}
                         
                 
                    </tbody>
                    </table>
                    <div>
                        <a 
                        className="btn btn-success" 
                         href="/IngresarUsuario"
                         role="button"
                          style={{marginRight:"10px", float:"right"}}>
                            Ingresar usuario
                            </a>   
                     </div>
                </div>

                    
            </React.Fragment>
          
        );
    }

}


export default VerReceta;
